import '../styles/main.css';



const Test = () =>
{
    return (<ul className="flex">
    <li className="mr-6">
      <a className="text-blue-500 hover:text-blue-800" href="#">StackOverflow</a>
    </li>
    <li className="mr-6">
      <a className="text-blue-500 hover:text-blue-800" href="#">Products</a>
    </li>
    <li className="mr-6">
      <a className="text-blue-500 hover:text-blue-800" href="#">Customers</a>
    </li>
    <li className="mr-6">
      <a className="text-blue-500 " href="#">Use Cases</a>
    </li>
  </ul>);
};

export default Test;
